// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/utils/ContextUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

import "./CreatorToken.sol";

contract Repository is OwnableUpgradeable {
  struct Issue {
    uint128 id;
    address creator;
    uint256 tokens;
    uint128 expiresOn;
    uint8[64] context; // a CID
  }

  event IssueCreate(uint256 indexed id, address indexed creator, uint8[64] indexed context, uint256 tokens, uint256 expiresOn);
  event IssueExpire(uint256 indexed id);
  event IssueResolve(uint256 indexed id);
  event IssueReject(uint256 indexed id);

  CreatorToken private _token;
  Issue[] private _issues;

  uint64 private _idCounter;
  uint8[64] private _context; // a CID

  bool public isRepository = true;

  function initialize(CreatorToken token_, uint8[64] calldata context_) public initializer {
    __Ownable_init();

    for(uint256 i = 0; i < 64; ++i){
      _context[i] = context_[i];
    }
    _idCounter = 1;
    _token = token_;
  }

  modifier onlyIssueCreator(uint128 id){
    Issue storage issue = _issueById(id);
    require(_msgSender() == issue.creator, "Only issue creator can modify issue");
    _;
  }

  function _slotFromId(uint128 id) internal pure returns (uint256) {
    return id >> 64;
  }

  function _issueById(uint128 id) internal view returns (Issue storage) {
    uint256 slot = _slotFromId(id);
    require(slot < _issues.length, "query for an inexistent issue");

    Issue storage issue = _issues[slot];
    require(issue.id == id && id != 0, "query for an inexistent issue");

    return issue;
  }

  function token() public view returns (address) {
    return address(_token);
  }

  function context() public view returns (uint8[64] memory) {
    return _context;
  }

  function issues() external view returns (Issue[] memory) {
    uint256 j = 0;

    for (uint256 i = 0; i < _issues.length; i++) {
      if (_issues[i].id != 0) {
        j++;
      }
    }
    Issue[] memory issues_ = new Issue[](j);
    j = 0;

    for (uint256 i = 0; i < _issues.length; i++) {
      if(_issues[i].id != 0) {
        issues_[j] = _issues[i];
        j += 1;
      }
    }
    return issues_;
  }

  function issueById(uint128 id) public view returns (Issue memory) {
    return _issueById(id);
  }

  function setContext(uint8[64] calldata context_) public {
    _context = context_;
  }

  function resolveIssue(uint128 id) public onlyIssueCreator(id) {
    Issue storage issue = _issueById(id);

    _token.transfer(owner(), issue.tokens);
    issue.id = 0;
    emit IssueResolve(id);
  }

  function claimExpiredTokens(uint128 id) public onlyIssueCreator(id) {
    Issue storage issue = _issueById(id);

    require(issue.expiresOn <= block.timestamp, "Cannot withdraw tokens before the issue has expired");
    _token.transfer(issue.creator, issue.tokens);

    issue.id = 0;
    emit IssueExpire(id);
  }

  function rejectIssue(uint128 id) public onlyOwner {
    Issue storage issue = _issueById(id);

    _token.transfer(issue.creator, issue.tokens);    
    issue.id = 0;
    emit IssueReject(id);
  }

  function createIssue(uint256 tokens, uint8[64] memory context_, uint128 expiresOn) public {
    uint256 slot = findEmptySlot();
    uint128 id = (uint128(slot) << 64) | uint128(_idCounter);

    Issue memory issue = Issue({ id: id, context: context_, creator: _msgSender(), expiresOn: expiresOn, tokens: tokens });

    if(slot == _issues.length){
      _issues.push(issue);
    } else {
      _issues[slot] = issue;
    }
    _token.transferFrom(_msgSender(), address(this), tokens);
    _idCounter++;

    emit IssueCreate(id, _msgSender(), context_, tokens, expiresOn);
  }

  function findEmptySlot() internal view returns(uint256) {
    for(uint i = 0; i < _issues.length; ++i){
      if(_issues[i].id == 0){
        return i;
      }
    }
    return _issues.length;
  }
}
